import { Grid, List } from '@mui/material';
import React, { useEffect, useState } from 'react';
import './styles/Search.module.css';

const Search = () => {
  const imgUrl = 'https://picsum.photos/200';

  const [img, setImg] = useState();

  const fetchImg = async () => {
    const res = await fetch(imgUrl);
    const imgBlob = await res.blob();
    const imgObjURL = URL.createObjectURL(imgBlob);
    setImg(imgObjURL);
  };

  useEffect(() => {
    fetchImg();
  }, []);

  return (
    <div className="">
      <div>
        <input className="" type="text" placeholder="Search" alt="Searching" />
      </div>
      <Grid className="grid">
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className="img"
        />
      </Grid>
    </div>
  );
};

export default Search;
